      height="450"
      style={{ border: 0 }}
      allowFullScreen=""
      loading="lazy"
      referrerPolicy="no-referrer-when-downgrade"
      title="myFrame"
    ></iframe>
      </div>

    </div>
  );
}

export default MyMap
